    return (
        <div className="menu">
            <div className="logo">Logo</div>
            <div className="menu-item">
                Search
            </div>

            <style jsx>{`
                .menu {
                    position: relative;
                    height: 100%;
                    width: 100%;
                    padding: 10px;
                    background: #3331a8;
                }

                .menu-item {
                    padding: 5px;
                    color: white;
                    cursor: pointer;
                    font-size: 18px;
                }

                .logo {
                    margin-bottom: 100px;
                }
            `}</style>
        </div>
    )
}

export default SideBar
